import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './ProfilePage.css';

const ProfilePage = () => {
  const navigate = useNavigate();
  const email = localStorage.getItem("userEmail");
  const [user, setUser] = useState(null);
  const [editMode, setEditMode] = useState(false);
  const [form, setForm] = useState({ name: '', role: '' });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  // Fetch user profile data when component mounts
  useEffect(() => {
    if (!email) {
      setError('No email found in localStorage');
      setLoading(false);
      return;
    }

    fetch(`http://localhost:8081/api/auth/${email}`)
      .then(res => {
        if (!res.ok) throw new Error("Failed to fetch user");
        return res.json();
      })
      .then(data => {
        setUser(data);
        setForm({ name: data.name, role: data.role });
        setLoading(false);
      })
      .catch(err => {
        console.error(err);
        setError('Failed to load profile.');
        setLoading(false);
      });
  }, [email]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm(prev => ({ ...prev, [name]: value }));
  };

  // Update user profile data via PUT
  const handleUpdate = async () => {
    try {
      const res = await fetch(`http://localhost:8081/api/auth/${email}`, {
        method: 'PUT',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ ...user, ...form }),
      });

      if (res.ok) {
        alert('Profile updated successfully');
        setEditMode(false);
        setUser(prev => ({ ...prev, ...form }));
      } else {
        alert('Update failed');
      }
    } catch (err) {
      console.error(err);
      alert('Server error');
    }
  };

  const handleCancel = () => {
    setForm({ name: user.name, role: user.role });
    setEditMode(false);
  };

  const handleBack = () => {
    navigate('/');
  };

  // Display loading or error states with matching CSS classes
  if (loading) {
    return (
      <div className="profile-container">
        <div className="profile-card loading">
          Loading profile...
        </div>
      </div>
    );
  }
  
  if (error) {
    return (
      <div className="profile-container">
        <div className="profile-card error">
          {error}
        </div>
      </div>
    );
  }

  return (
    <div className="profile-container">
      <div className="profile-card">
        <div className="profile-header">
          <h1>User Profile</h1>
        </div>
        
        <div className="profile-info">
          <div className="info-item">
            <span className="info-label">Email:</span>
            <span className="info-value">{user.email}</span>
          </div>
          
          {editMode ? (
            <div className="edit-form">
              <div className="form-group">
                <label>Name:</label>
                <input
                  name="name"
                  value={form.name}
                  onChange={handleChange}
                  placeholder="Enter your name"
                />
              </div>
              <div className="form-group">
                <label>Role:</label>
                <select
                  name="role"
                  value={form.role}
                  onChange={handleChange}
                >
                  <option value="CLIENT">Client</option>
                  <option value="FREELANCER">Freelancer</option>
                </select>
              </div>
              <div className="button-group">
                <button className="btn btn-primary" onClick={handleUpdate}>
                  Save Changes
                </button>
                <button className="btn btn-secondary" onClick={handleCancel}>
                  Cancel
                </button>
              </div>
            </div>
          ) : (
            <div className="view-mode">
              <div className="info-item">
                <span className="info-label">Name:</span>
                <span className="info-value">{user.name}</span>
              </div>
              <div className="info-item">
                <span className="info-label">Role:</span>
                <span className="info-value">{user.role}</span>
              </div>
              <div className="button-group">
                <button className="btn btn-primary" onClick={() => setEditMode(true)}>
                  Edit Profile
                </button>
              </div>
            </div>
          )}
          
          <div className="button-group">
            <button className="btn btn-secondary" onClick={handleBack}>
              Back to Home
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ProfilePage;
